def is_prime(n):
    if n < 1:
        return False
    elif n <= 3:
        return True
    elif n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i += 6
    return True

def create_prime_linked_list():
    dll = DoublyLinkedList()
    for i in range(2, 30):
        if is_prime(i):
            dll.append(i)
    return dll

